export const Signup = () => {


  return (
    <div className="bg">
        <div style={styles.container}>
        <div className="box" style={styles.box}>
            <div className="text" style={{ color:"black", fontSize:26}}>Sign Up</div>
            <div className="input">
                <input type="name" className="input" placeholder='Enter your name'/>   
            </div>
            <div className="input">
                <input type="email" className="input" placeholder='Email' value={email}
          onChange={(e) => setEmail(e.target.value)}/>   
            </div>
            <div className="input">
                <input type="password" className="input" placeholder='Password' />   
            </div>
            <button className="login" >Create Account</button>
            <button className="signout">signout</button>

            <p>Already have an account? <Link to='/Login'> Log In.</Link></p>
        </div>
        </div>
    </div>
  )
}
const styles = {
    label:{
        minHeight:"20px"

    },
    box:{
        width:'400px',
        height:'auto',
